import React from 'react';
import styles from './HomePage.module.css';
import Container from '@material-ui/core/Container';
function Home() {
  return (
    <Container>
      <div>
        <p className={styles.test}>Home</p>
      </div>
    </Container>
  );
}

export default Home;
